create table rangetableData
(
    muzzleVelocity  float        not null,
    airFriction     float        not null,
    `range`         int unsigned not null,
    elevation       varchar(255) not null,
    heightElevation varchar(255) not null,
    heightTimeDelta varchar(255) not null,
    timeOfFlight    varchar(255) not null,
    crosswindDeg    varchar(255) not null,
    headwindMeters  varchar(255) not null,
    tailwindMeters  varchar(255) not null,
    tempDec         varchar(255) not null,
    tempInc         varchar(255) not null,
    airDensDec      varchar(255) not null,
    airDensInc      varchar(255) not null,
    constraint rangetableData_pk
        unique (muzzleVelocity, airFriction, `range`)
);

